    const [cookies, setCookie] = useCookies();
    return cookies.user != null ? <Outlet /> : <Navigate to="/" />;

    /*return isLogged ? <Outlet /> : <Navigate to="/" />;*/
    console.log(cookies.user);
}

export default PrivateRoute;
